import React, { useState, useEffect } from "react";
import {
  Dialog,
  DialogContent,
  DialogTitle,
  Typography,
  DialogActions,
  Button,
  Grid,
  Switch,
} from "@material-ui/core";
import { fetchdData, fetchDetail } from "../../redux/fetchData";

//form
import InputTextField from "./Form/InputTextField";

function DialogEditUsers(props) {
  const { history } = props;
  let params = new URLSearchParams(props);
  console.log("ini props dialog =>", props, params.get("users"));

  //redux
  let dispatch = useDispatch();

  useEffect(() => {
    dispatch(fetchdData());
  }, []);

  const handleCancel = () => {
    history.goBack();
  };

  return (
    <Dialog open={true} aria-labelledby="form-dialog-edit-users" fullWidth>
      <DialogTitle>
        <Typography component="span" variant="h4">
          <b> Edit Data</b>
        </Typography>
      </DialogTitle>
      <DialogContent>
        <Grid container spacing={2}>
          <Grid item xs={12}>
            <Typography component="span">Name</Typography>
            <InputTextField fullWidth keys="name" />
          </Grid>
          <Grid item xs={12}>
            <Typography component="span">Comment</Typography>
            <InputTextField fullWidth multiline rows={4} keys="comment" />
          </Grid>
          <Grid item xs={12}>
            <Typography component="span">Is active</Typography>
            <Switch name="checkedA" />
          </Grid>
        </Grid>
      </DialogContent>
      <DialogActions>
        <Button color="primary" onClick={handleCancel}>
          Cancel
        </Button>
        <Button color="primary">Subscribe</Button>
      </DialogActions>
    </Dialog>
  );
}

export default DialogEditUsers;
